INSERT INTO `wp_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(1, 1, 'Một người bình luận WordPress', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2022-03-14 03:24:20', '2022-03-14 03:24:20', 'Xin chào, đây là một bình luận\nĐể bắt đầu với quản trị bình luận, chỉnh sửa hoặc xóa bình luận, vui lòng truy cập vào khu vực Bình luận trong trang quản trị.\nAvatar của người bình luận sử dụng <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', 'comment', 0, 0);
INSERT INTO `wp_my_books` (`id`, `name`, `author`, `category`, `about`, `book_image`, `created_at`) VALUES
(2, 'Thế Giới Rộng Lớn Lòng Người Chật Hẹp ', 'Nhà Xuất Bản Văn Học', 'Sách tư duy - Kỹ năng sống', 'Bạn có biết mỗi một người trong chúng ta đều mang bên mình một thế giới riêng? Thế giới ấy là do bạn tạo dựng nên từ khi vừa được sinh ra.\n\nGiữa thế giới thực và thế giới riêng của bạn luôn tồn tại những điểm khác nhau. Đó là nơi bạn trú ngụ chiếc bóng chân thật của mình, nơi mà ít ai có quyền được biết đến.', 'http://demo.local/wp-content/uploads/2022/05/smart_home.webp', '2022-07-30 02:48:48'),
(3, 't1', 't1', 'Sách tư duy - Kỹ năng sống', 't1', 'http://demo.local/wp-content/uploads/2022/05/airb-hardware.webp', '2022-07-30 02:51:03'),
(4, 't2', 't2', 'Sách tư duy - Kỹ năng sống', 't2', 'http://demo.local/wp-content/uploads/2022/05/bkav_pro_mobile.webp', '2022-07-30 02:51:44'),
(5, 'Gửi Bạn, Người Đã Kiệt Sức Vì Những Chịu Đựng Âm Thầm', 'Tăng Phúc Nguyên ', 'Sách tư duy - Kỹ năng sống', 'Bất kỳ ai giữa cuộc sống,\n\nĐều sẽ có khoảnh khắc kiệt sức hoặc chẳng còn yêu thích bất cứ điều gì.\n\nĐó là khoảnh khắc bản thân trở nên yếu đuối nhất trong cuộc đời.\n\nĐừng tự trách bản thân đã trở nên yếu đuối như thế.\n\nLý do bạn kiệt sức, lý do bạn không còn yêu thích điều gì\n\nĐều không phải lỗi của bạn.\n\nChỉ là bạn đã luôn muốn phải làm thật tốt.\n\nĐể rồi bỗng dưng kiệt sức\n\nHoặc bỗng dưng không biết bản thân yêu thích điều gì hoặc đã lỡ mất điều gì.', 'http://demo.local/wp-content/uploads/2022/05/centralized_governance.png', '2022-07-30 02:53:22'),
(6, 'sach 1', 'toan1', 'Truyện ngắn', 'sach 1', 'http://demo.local/wp-content/uploads/2022/05/bkav_pro_mobile.webp', '2022-07-30 04:54:34'),
(7, 'sach 2', 'sach 2', 'Truyện ngắn', 'sach 2', 'http://demo.local/wp-content/uploads/2022/05/bkav_pro_ai.webp', '2022-07-30 04:54:48'),
(8, 'sach 3', 'sach 3', 'How to ', 'sach 3', 'http://demo.local/wp-content/uploads/2022/05/ai_bg.webp', '2022-07-30 04:55:01');
