(17, 1, '2022-05-16 01:35:58', '2022-05-16 01:35:58', '<!-- wp:html /-->\n\n<!-- wp:paragraph -->\n<p>Bkav là Tập đoàn công nghệ hoạt động trong các lĩnh vực an ninh mạng, phần mềm, chính phủ điện tử, nhà sản xuất smartphone, thiết bị điện tử thông minh, Smart City và AI camera. Bkav là 1 trong 10 thương hiệu Nổi tiếng nhất Việt Nam do Hội Sở hữu trí tuệ Việt Nam bình chọn, nằm trong Top 10 Dịch vụ hoàn hảo do Hội Tiêu chuẩn Bảo vệ Người tiêu dùng Việt Nam bình chọn.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Với kim chỉ nam, phát triển khoa học công nghệ giúp đất nước giàu mạnh, nâng tầm tự chủ, uy tín và thương hiệu quốc gia, Tập đoàn Bkav tự nhận về mình sứ mệnh xây dựng và bảo vệ đất nước bằng khoa học, công nghệ. Những việc nào hữu ích cho xã hội, sử dụng đến công nghệ thì nhất định Bkav sẽ làm, bất kể đó là việc gì. Mục tiêu là phát triển đất nước dựa vào công nghệ, đưa Việt Nam trở thành con rồng thứ 5 của châu Á.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Smartphone là tinh hoa của công nghệ cao, hội tụ các công nghệ thiết kế điện tử, thiết kế cơ khí, thiết kế kiểu dáng công nghiệp, công nghệ phần mềm, công nghệ camera, công nghệ âm thanh, công nghệ ăng-ten, công nghệ bảo mật, công nghệ sản xuất. Bkav tiên phong xây dựng ngành công nghiệp sản xuất smartphone của Việt Nam. Là nhà sản xuất đầu tiên trên thế giới đưa AI vào camera trên smartphone. Hai năm liên tiếp sự kiện ra mắt điện thoại thông minh Bphone đều được bình chọn là một trong 10 sự kiện công nghệ của năm.</p>\n<!-- /wp:paragraph -->', 'Giới thiệu', '', 'publish', 'open', 'open', '', 'gioi-thieu', '', '', '2022-05-16 01:49:34', '2022-05-16 01:49:34', '', 0, 'http://nam.local/?p=17', 0, 'post', '', 0),
