(47, 1, '2022-05-16 02:30:16', '2022-05-16 02:30:16', '<!-- wp:html /-->\n\n<!-- wp:paragraph -->\n<p>Chỉ một nút bấmThông thường để điều khiển tất cả các thiết bị trong nhà, bạn cần tới hàng chục công tắc, thậm chí với căn nhà lớn hàng trăm công tắc. Với nhà thông minh Bkav SmartHome, bạn có thể điều khiển tất cả bằng một vài nút bấm trên màn hình cảm ứng của smartphone hay máy tính bảng. Bạn cũng có thể điều khiển và kiểm soát ngôi nhà thông qua giao diện trực quan 3D, ở đó các thiết bị được mô phỏng giống như đang sử dụng thực tế, chỉ cần chạm vào thiết bị tương ứng trong màn hình để điều khiển.</p>\n<!-- /wp:paragraph -->', 'Nhà thông minh', '', 'publish', 'closed', 'closed', '', 'nha-thong-minh', '', '', '2022-05-16 02:30:17', '2022-05-16 02:30:17', '', 0, 'http://nam.local/?page_id=47', 0, 'page', '', 0),
