(57, 1, '2022-05-16 02:36:10', '2022-05-16 02:36:10', '<!-- wp:flatsome/uxbuilder -->\n[row]\n\n[col span__sm=\"12\"]\n\n[ux_banner height=\"500px\" bg=\"35\"]\n\n[text_box position_x=\"50\" position_y=\"50\"]\n\n<h3 class=\"uppercase\">CÔNG NGHỆ AI</h3>\n<div class=\"sm-text-ai-tech text-ai-desk-1\">Giải pháp Bkav AI là giải pháp toàn diện ứng dụng công nghệ AI cung cấp cho chính phủ, doanh nghiệp và khách hàng cá nhân nhằm hỗ trợ chuyển đổi số, an ninh an toàn, nâng cao năng suất, tăng cường trải nghiệm khách hàng...</div>\n<div class=\"sm-text-ai-tech text-ai-desk-2\">Giải pháp Bkav AI gồm các hệ thống như: Camera AI, AI View Platform, AI View Cloud và các giải pháp AI khác trong các lĩnh vực hình ảnh, âm thanh và ngôn ngữ.</div>\n\n[/text_box]\n\n[/ux_banner]\n\n[/col]\n\n[/row]\n[section]\n\n[row]\n\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image_box img=\"56\" image_height=\"56.25%\"]\n\n<h4 style=\"text-align: left;\"><a href=\"https://www.bkav.com.vn/bkav-pro\">Bkav Pro AI</a></h4>\n<p style=\"text-align: left;\">Sản phẩm đẳng cấp Quốc tế Phần mềm tốt nhất do Hiệp hội An toàn thông tin VN bình chọn</p>\n<p style=\"text-align: left;\"><span class=\"bg-text-price\">299.000</span> <span class=\"sm-text-price\">Vnđ</span></p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image_box img=\"53\" image_height=\"56.25%\"]\n\n[ux_text text_align=\"left\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm/endpoint\">Bkav Endpoint AI</a></h4>\n<p>Giải pháp phòng chống mã độc cho cơ quan doanh nghiệp. Bảo vệ toàn bộ hệ thống mạng trước nguy cơ về mã độc...</p>\n[/ux_text]\n\n[/ux_image_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n[ux_text text_align=\"left\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkavpro-mobile\">Bkav Pro Mobile</a></h4>\n<p>Phần mềm cho Smartphone, bảo vệ giao dịch ngân hàng, diệt vius, chặn tin nhắn rác tốt nhất</p>\n<p><span class=\"bg-text-price\">99.000</span> <span class=\"sm-text-price\">Vnđ</span></p>\n[/ux_text]\n\n[/ux_image_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\"]\n\n[ux_image_box img=\"54\" image_height=\"56.25%\"]\n\n[ux_text text_align=\"left\"]\n\n<h4><a href=\"https://www.bkav.com.vn/download/bkav-home\">Bkav Home</a></h4>\n<p>Miễn phí, tính năng cơ bản. Nếu có điều kiện, bạn mua Bkav Pro để đạt hiệu quả cao nhất</p>\n[/ux_text]\n\n[/ux_image_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section]\n\n[ux_text text_align=\"left\"]\n\n<h2>Chuyển đổi số</h2>\n[/ux_text]\n[row]\n\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkav-sme\">Chuyển đổi số SME</a></h4>\n<p>Nền tảng tổng thể Chuyển đổi số Quản trị doanh nghiệp vừa và nhỏ Bkav VALA</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"31\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkav-enterprise\">Chuyển đổi số Enterprise</a></h4>\n<p>Bộ giải pháp tổng thể chuyển đổi số giúp doanh nghiệp hoạt động hiệu quả trên môi trường số.</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkav-gov\">Chuyển đổi số GOV</a></h4>\n<p>Bộ giải pháp tổng thể chuyển đổi số khối GOV với 3 trụ cột: Chính phủ số, kinh tế số và xã hội số.</p>\n\n[/ux_image_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section]\n\n[ux_text text_align=\"left\"]\n\n<h2>An ninh mạng</h2>\n[/ux_text]\n[row]\n\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm#focusdevice\">Giải pháp an ninh mạng</a></h4>\n<p>Bộ giải pháp an ninh mạng toàn diện đảm bảo an toàn thông tin ở mức cao nhất cho khách hàng.</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"31\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm#focusdv\">Dịch vụ an ninh mạng</a></h4>\n<p>Dịch vụ an ninh mạng tổng thể, xác định và xử lý triệt để các nguy cơ an ninh đang tồn tại trong toàn bộ hệ thống.</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm#focusdv\">Đào tạo an ninh mạng</a></h4>\n<p>Dịch vụ đào tạo an ninh mạng uy tín với đội ngũ giảng viên hàng đầu và hệ thống Lab tiên tiến.</p>\n\n[/ux_image_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[row]\n\n[col span__sm=\"12\"]\n\n<h2>Tin tức</h2>\n[blog_posts style=\"shade\" type=\"grid\" grid=\"4\" grid_height=\"300px\"]\n\n\n[/col]\n\n[/row]\n\n<!-- /wp:flatsome/uxbuilder -->', 'Trang chủ', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2022-05-16 02:36:10', '2022-05-16 02:36:10', '', 10, 'http://nam.local/?p=57', 0, 'revision', '', 0);
