(59, 1, '2022-05-25 02:57:11', '2022-05-25 02:57:11', '<!-- wp:html /-->\n\n<!-- wp:paragraph -->\n<p><strong>Hướng dẫn gỡ bỏ phần mềm trên máy tính</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Trong quá trình sử dụng máy tính, người sử dụng có thể gặp phải các sự cố liên quan đến phần mềm: phần mềm bị lỗi, máy tính hoạt động chậm do cài đặt nhiều phần mềm không thường xuyên sử dụng… Để máy tính hoạt động ổn định hơn, trong quá trình sử dụng, bạn nên kiểm tra, gỡ bỏ các phần mềm bị lỗi, các phần mềm không thường xuyên sử dụng.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Để gỡ bỏ phần mềm trên máy tính, bạn hãy thực hiện theo hướng dẫn bên dưới, tương ứng với hệ điều hành bạn đang sử dụng (Nếu không rõ bạn đang sử dụng phiên bản hệ điều hành nào, bạn có thể xem hướng dẫn&nbsp;<a href=\"http://www.bkav.com.vn/ho_tro_khach_hang/-/chi_tiet/51053/he-%C4%91ieu-hanh-la-gi-lam-sao-%C4%91e-biet-may-tinh-%C4%91ang-su-dung-phien-ban-he-%C4%91ieu-hanh-windows-nao-\">tại đây</a>):</p>\n<!-- /wp:paragraph -->', 'Tải về', '', 'publish', 'open', 'open', '', 'tai-ve-2', '', '', '2022-05-25 02:57:11', '2022-05-25 02:57:11', '', 0, 'http://demo.local/?p=59', 0, 'post', '', 0),
(60, 1, '2022-05-25 02:57:11', '2022-05-25 02:57:11', '<!-- wp:html /-->\n\n<!-- wp:paragraph -->\n<p><strong>Hướng dẫn gỡ bỏ phần mềm trên máy tính</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Trong quá trình sử dụng máy tính, người sử dụng có thể gặp phải các sự cố liên quan đến phần mềm: phần mềm bị lỗi, máy tính hoạt động chậm do cài đặt nhiều phần mềm không thường xuyên sử dụng… Để máy tính hoạt động ổn định hơn, trong quá trình sử dụng, bạn nên kiểm tra, gỡ bỏ các phần mềm bị lỗi, các phần mềm không thường xuyên sử dụng.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Để gỡ bỏ phần mềm trên máy tính, bạn hãy thực hiện theo hướng dẫn bên dưới, tương ứng với hệ điều hành bạn đang sử dụng (Nếu không rõ bạn đang sử dụng phiên bản hệ điều hành nào, bạn có thể xem hướng dẫn&nbsp;<a href=\"http://www.bkav.com.vn/ho_tro_khach_hang/-/chi_tiet/51053/he-%C4%91ieu-hanh-la-gi-lam-sao-%C4%91e-biet-may-tinh-%C4%91ang-su-dung-phien-ban-he-%C4%91ieu-hanh-windows-nao-\">tại đây</a>):</p>\n<!-- /wp:paragraph -->', 'Tải về', '', 'inherit', 'closed', 'closed', '', '59-revision-v1', '', '', '2022-05-25 02:57:11', '2022-05-25 02:57:11', '', 59, 'http://demo.local/?p=60', 0, 'revision', '', 0),
(61, 1, '2022-05-25 02:57:50', '2022-05-25 02:57:50', '<!-- wp:html /-->\n\n<!-- wp:paragraph -->\n<p>Chúng tôi đang có nhu cầu tìm kiếm những ứng viên có năng lực vào vị trí&nbsp;<strong>kỹ sư thiết&nbsp;</strong><strong>kế&nbsp;</strong><strong>lập trình nhúng</strong>&nbsp;làm việc tại Hà Nội.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Số lượng nhân viên:</strong>&nbsp;1 người</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Mô tả công việc:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Lên giải pháp, thực hiện phần mềm cho các sản phẩm SmartHome.</li><li>Lên giải pháp, cấu hình phần mềm cho khối RF trong các dự án Smartphone, IoT của công ty.</li><li>Lên kịch bản, viết phần mềm và ứng dụng để hỗ trợ nghiên cứu, sản xuất.</li><li>Trao đổi với các đối tác công ty để cập nhật và tích hợp các công nghệ mới vào các dự án.</li><li>Tìm hiểu, báo cáo, Seminar thường xuyên về các công nghệ và sản phẩm mới</li></ul>\n<!-- /wp:list -->', 'Tuyển dụng', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2022-05-25 02:57:50', '2022-05-25 02:57:50', '', 19, 'http://demo.local/?p=61', 0, 'revision', '', 0),
