(96, 1, '2022-05-27 03:49:51', '2022-05-27 03:49:51', '<!-- wp:paragraph -->\n<p><strong>Hệ thống y tế Hợp Lực thuộc Tổng Công ty Cổ phần Hợp Lực gồm: Bệnh viện Đa khoa Hợp Lực (TP. Thanh Hoá thành lập năm 2005); Bệnh viện Đa khoa Quốc tế Hợp Lực (Thị xã Nghi Sơn thành lập 2019); là 2 bệnh viện hàng đầu y tế tư nhân, hai bệnh viện, Bệnh viện Đa khoa Quốc tế Thọ Xuân; Bệnh viện Đa khoa Quốc tế Thành phố Huế sẽ khánh thành và đi vào hoạt động vào khoảng quý 4 năm 2022 có nhu cầu mời:</strong></p>\n<!-- /wp:paragraph -->', 'CHƯƠNG TRÌNH TUYỂN DỤNG Y, BÁC SĨ MỞ RỘNG VÀ LỚN NHẤT', '', 'publish', 'closed', 'closed', '', 'chuong-trinh-tuyen-dung-y-bac-si%cc%83-mo-rong-va-lon-nhat', '', '', '2022-05-27 04:32:02', '2022-05-27 04:32:02', '', 0, 'http://demo.local/?post_type=recruitment&#038;p=96', 0, 'recruitment', '', 0),
