(107, 1, '2022-07-30 04:21:14', '2022-07-30 04:21:14', '<!-- wp:flatsome/uxbuilder -->\n[row]\n\n[col span__sm=\"12\"]\n\n[ux_slider]\n\n[ux_banner height=\"500px\" bg=\"35\"]\n\n[text_box position_x=\"50\" position_y=\"50\"]\n\n<h3 class=\"uppercase\">CÔNG NGHỆ AI</h3>\n<div class=\"sm-text-ai-tech text-ai-desk-1\">Giải pháp Bkav AI là giải pháp toàn diện ứng dụng công nghệ AI cung cấp cho chính phủ, doanh nghiệp và khách hàng cá nhân nhằm hỗ trợ chuyển đổi số, an ninh an toàn, nâng cao năng suất, tăng cường trải nghiệm khách hàng...</div>\n<div class=\"sm-text-ai-tech text-ai-desk-2\"> </div>\n\n[/text_box]\n\n[/ux_banner]\n[ux_banner height=\"500px\" bg=\"35\"]\n\n[text_box position_x=\"50\" position_y=\"50\"]\n\n<h3 class=\"uppercase\">Bphone A40</h3>\n\n[/text_box]\n\n[/ux_banner]\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n[section]\n\n[row v_align=\"equal\"]\n\n[col span=\"3\" span__sm=\"12\" animate=\"fadeInLeft\"]\n\n[ux_image_box img=\"56\" image_height=\"56.25%\" image_hover=\"fade-in\"]\n\n<h4 style=\"text-align: left;\"><a href=\"https://www.bkav.com.vn/bkav-pro\">Bkav Pro AI</a></h4>\n<p style=\"text-align: left;\">Sản phẩm đẳng cấp Quốc tế Phần mềm tốt nhất do Hiệp hội An toàn thông tin VN bình chọn</p>\n<p style=\"text-align: left;\"><span class=\"bg-text-price\">299.000</span> <span class=\"sm-text-price\">Vnđ</span></p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\" animate=\"fadeInLeft\"]\n\n[ux_image_box img=\"53\" image_height=\"56.25%\"]\n\n[ux_text text_align=\"left\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm/endpoint\">Bkav Endpoint AI</a></h4>\n<p>Giải pháp phòng chống mã độc cho cơ quan doanh nghiệp. Bảo vệ toàn bộ hệ thống mạng trước nguy cơ về mã độc...</p>\n[/ux_text]\n\n[/ux_image_box]\n\n[/col]\n[col span=\"3\" span__sm=\"12\" animate=\"fadeInLeft\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n[ux_text text_align=\"left\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkavpro-mobile\">Bkav Pro Mobile</a></h4>\n<p>Phầ