thế giới, công nghệ vượt trội so với các sản phẩm của Mỹ và Châu Âu...</div>\n\n[/ux_image_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section]\n\n[ux_text text_align=\"left\"]\n\n<h2>Chuyển đổi số</h2>\n[/ux_text]\n[row]\n\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkav-sme\">Chuyển đổi số SME</a></h4>\n<p>Nền tảng tổng thể Chuyển đổi số Quản trị doanh nghiệp vừa và nhỏ Bkav VALA</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"31\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkav-enterprise\">Chuyển đổi số Enterprise</a></h4>\n<p>Bộ giải pháp tổng thể chuyển đổi số giúp doanh nghiệp hoạt động hiệu quả trên môi trường số.</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/bkav-gov\">Chuyển đổi số GOV</a></h4>\n<p>Bộ giải pháp tổng thể chuyển đổi số khối GOV với 3 trụ cột: Chính phủ số, kinh tế số và xã hội số.</p>\n\n[/ux_image_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[section]\n\n[ux_text text_align=\"left\"]\n\n<h2>An ninh mạng</h2>\n[/ux_text]\n[row]\n\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm#focusdevice\">Giải pháp an ninh mạng</a></h4>\n<p>Bộ giải pháp an ninh mạng toàn diện đảm bảo an toàn thông tin ở mức cao nhất cho khách hàng.</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"31\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm#focusdv\">Dịch vụ an ninh mạng</a></h4>\n<p>Dịch vụ an ninh mạng tổng thể, xác định và xử lý triệt để các nguy cơ an ninh đang tồn tại trong toàn bộ hệ thống.</p>\n\n[/ux_image_box]\n\n[/col]\n[col span=\"4\" span__sm=\"12\"]\n\n[ux_image_box img=\"35\" image_height=\"56.25%\"]\n\n<h4><a href=\"https://www.bkav.com.vn/anm#focusdv\">Đào tạo an ninh mạng</a></h4>\n<p>Dịch vụ đào tạo an ninh mạng uy tín với đội ngũ giảng viên hàng đầu và hệ thống Lab tiên tiến.</p>\n\n[/ux_image_box]\n\n[/col]\n\n[/row]\n\n[/section]\n[row]\n\n[col span__sm=\"12\"]\n\n<h2>Tin tức</h2>\n[gap height=\"100px\"]\n\n[blog_posts style=\"push\" type=\"row\" columns=\"3\" animate=\"fadeInLeft\" posts=\"3\" show_date=\"false\"]\n\n\n[/col]\n\n[/row]\n\n<!-- /wp:flatsome/uxbuilder -->', 'Trang chủ', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2022-07-30 04:21:14', '2022-07-30 04:21:14', '', 10, 'http://demo.local/?p=107', 0, 'revision', '', 0);
